import layout from '../styled/layout/layout.styled';
import navigation from '../styled/navigation/navigation.styled';
import profile from '../styled/profile/profile.styled';
import shared from '../styled/shared/shared.styled';

const style_mapping = {
    layout,
    navigation,
    profile,
    shared
};

export { style_mapping };
